    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-ph-temperature-salinity-and-other-variables-collected-from-discrete-",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0112351 includes biological,
    chemical, discrete sample, physical and profile data collected from MIRAI in the
    North Pacific Ocean and South Pacific Ocean from 1999-11-21 to 1999-12-27 and retrieved
    during cruise MR98-K07 and PACIFICA_49NZ19991121. These data include AMMONIUM, CHLOROPHYLL,
    CHLOROPHYLL A, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, FLUORESCENCE, HYDROSTATIC
    PRESSURE, NITRATE, NITRITE, PHAEOPHYTIN, PHOSPHATE, Potential temperature (theta),
    SALINITY, SIGMA-T, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect
    these data include CTD, Coulometer for DIC measurement and bottle. These data were
    collected by Takeshi Kawano of Japan Agency for Marine-Earth Science and Technology
    (Jamstec) and Masao Ishii of Meteorological Research Institute; Geochemical Research
    Department as part of the PACIFICA_49NZ19991121 data set.nnPACIFICA (PACIFic ocean
    Interior CArbon) was an international collaborative project for the data synthesis
    of ocean interior carbon and its related parameters in the Pacific Ocean. The North
    Pacific Marine Science Organization (PICES), Section of Carbon and Climate (S-CC)
    supported the project.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
